import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/common/ProtectedRoute';
import Navbar from './components/layout/Navbar';
import Footer from './components/layout/Footer';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import BusinessSetup from './components/auth/BusinessSetup';
import Dashboard from './components/dashboard/Dashboard';
import GenerateWebsite from './components/services/GenerateWebsite';
import SocialMediaGuide from './components/services/SocialMediaGuide';
import GenerateAd from './components/services/GenerateAd';
import MarketingStrategy from './components/services/MarketingStrategy';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="app">
          <Navbar />
          <main className="main-content">
            <Routes>
              <Route path="/" element={<Navigate to="/dashboard" />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route 
                path="/business-setup" 
                element={
                  <ProtectedRoute>
                    <BusinessSetup />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/dashboard" 
                element={
                  <ProtectedRoute>
                    <Dashboard />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/services/website" 
                element={
                  <ProtectedRoute>
                    <GenerateWebsite />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/services/social" 
                element={
                  <ProtectedRoute>
                    <SocialMediaGuide />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/services/ads" 
                element={
                  <ProtectedRoute>
                    <GenerateAd />
                  </ProtectedRoute>
                } 
              />
              <Route 
                path="/services/marketing" 
                element={
                  <ProtectedRoute>
                    <MarketingStrategy />
                  </ProtectedRoute>
                } 
              />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
